h3. {color:#172b4d}added a comment -{color}

 

Hi Sudhanshu,
 
 
In the order overview the “cancel” button will be enabled, if the order is in status pending and at least one included package is in status “OnHold–PendingOnlineIdentification” or “OnHold-PendingOnlineIdentSignDoc”. Clicking on the button will call a synchronic OGW service CancelOrderLines, for cancelling all mobile postpaid packages pending for online ident in OGW. In case the order is not in the correct status anymore the service will send an error message stating the reason for not executing the cancel request. If the current status of the order still allowing the cancellation, then the status of all pending mobile postpaid packages will be set to “Completed-CustomerCancelled”, the onlineIdent process will be cancelled and the pending orchestration workflow will be terminated. Statuses updates will be communicated to Omnius with standard functionality.;;;

